import React from "react";
import Link from "next/link";
import styled from "styled-components";
const WrapperBox = styled.div`
  background: black;
`;

export default function Home() {
  return (
    <ul>
      <li>
        <Link href="/b" as="/a">
          <WrapperBox>a</WrapperBox>
        </Link>
      </li>
      <li>
        <Link href="/a" as="/b">
          <WrapperBox>b</WrapperBox>
        </Link>
      </li>
    </ul>
  );
}
